import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import Frame from "react-frame-component";
//import registerServiceWorker from './registerServiceWorker';

ReactDOM.render(
  <Frame>
    <App />, document.getElementById("root")
  </Frame>,
  document.body
);
